  false,\n\t\"url\": null,\n\t\"notes\": \"This Evaluation of Ecosystem Restoration
  and Management Options covers the hydrogeomorphic analysis (HGM) for Lee Metcalf
  National Wildlife Refuge.  This three step process outlines the historical landscape,
  contemporary changes from pre-settlement conditions, restoration and management
  options and monitoring and evaluation needs for the Lee Metcalf NWR along the Bitterroot
  River. Topics include geomorphology, soils, topography/elevation, climate, vegetation
  and hydrology.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
